import "./App.css";
import Navbar from "./components/Navbar";
import Boxes from "./components/Boxes";
import ContactUs from "./components/ContactUs";

function App() {
  return (
    <div className="App">
      <Navbar />
      <Landing />
      <Boxes />
      <ContactUs />
    </div>
  );
}

export default App;
